import React, { Component } from 'react';
import { connect } from 'react-redux'
import { } from '../../../redux/actions/users.js'
import { Container, Segment, Header, Divider, Grid, Input } from 'semantic-ui-react'

class Deposit extends Component {

  render() {
    return(
      <Container>
        <Segment>
          <Grid columns={2} relaxed='very'>
            <Grid.Column>
              <Header>Account</Header>
              <Input
                action={{ color: 'teal', labelPosition: 'left', icon: 'plus', content: 'Deposit' }}
                actionPosition='left'
                placeholder='Search...'
                defaultValue='52.03'
              />
            </Grid.Column>
            <Grid.Column>
              <Header>Bank</Header>
            </Grid.Column>
          </Grid>

          <Divider vertical>Make A Deposit</Divider>
        </Segment>
      </Container>
    )
  }
}

export default connect(null, { })(Deposit);
